const Header = styled.header`
    height: 90vh;
    width: 100%;
    padding-top: 100px;
`;

const Image = styled.img`
    height: 90vh;
    position: absolute;
    top: 0;
    left: 50%;
    transform: translateX(-50%);
    z-index: 0;
`;

const Index = () => {
    return (

        <Layout>
            <Header>
                <Title className="">Past Launches</Title>
                <Image src="/images/home_moon.webp" alt="Logo"/> 
            </Header>
            <LaunchesContainer />
        </Layout>

    )
}



export default Index;
